  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line Files are shapefiles and
  related database files (.dbf) that are an extract of selected geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The MTDB represents
  a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
  File is designed to stand alone as an independent data set, or they can be combined
  to cover the entire nation. Block Groups (BGs) are defined before tabulation block
  delineation and numbering, but are clusters of blocks within the same census tract
  that have the same first digit of their 4-digit census block number from the same
  decennial census. For example, Census 2000 tabulation blocks 3001, 3002, 3003,..,
  3999 within Census 2000 tract 1210.02 are also within BG 3 within that census tract.
  Census 2000 BGs generally contained between 600 and 3,000 people, with an optimum
  size of 1,500 people. Most BGs were delineated by local participants in the Census
  Bureau's Participant Statistical Areas Program (PSAP). The Census Bureau delineated
  BGs only where the PSAP participant declined to delineate BGs or where the Census
  Bureau could not identify any local PSAP participant. A BG usually covers a contiguous
  area. Each census tract contains at least one BG, and BGs are uniquely numbered
  within census tract. Within the standard census geographic hierarchy, BGs never
  cross county or census tract boundaries, but may cross the boundaries of other geographic
  entities like county subdivisions, places, urban areas, voting districts, congressional
  districts, and American Indian / Alaska Native / Native Hawaiian areas. BGs have
  a valid code range of 0 through 9. BGs coded 0 were intended to only include water
  area, no land area, and they are generally in territorial seas, coastal water, and
  Great Lakes water areas. For Census 2000, rather than extending a census tract boundary
  into the Great Lakes or out to the U.S. nautical three-mile limit, the Census Bureau
  delineated some census tract boundaries along the shoreline or just offshore. The
  Census Bureau assigned a default census tract number of 0 and BG of 0 to these offshore,
  water-only areas not included in regularly numbered census tract areas.\",\n\t\"owner_org\":
